import ReactDOM from "react-dom";
import React, { Component } from "react";

export default class Card extends Component<{
  children?: React.Node
}> {
  render() {
    return (
      <div className="card ">
        <div className="card-body">
          <div className="card-text">{this.props.children}</div>
        </div>
      </div>
    );
  }
}
